import React from "react";
import ButtonDiv from "./styles";


const Button=(props)=> {
  return (
    <ButtonDiv onClick={props.Click} disabled={props.disabled}>
      <h2>{props.children}</h2>
    </ButtonDiv>
  );
}


export default Button;
